import React, { useState, useEffect } from 'react';
import '../../styles/15.css'; // Asegúrate de que la ruta sea correcta
import { useNavigate } from 'react-router-dom';

const Quince = () => {
    const [centimeters, setCentimeters] = useState('');
    const [meters, setMeters] = useState('');
    const [printFunction, setPrintFunction] = useState('');
    const [output, setOutput] = useState('');
    const [showNext, setShowNext] = useState(false);
    const [score, setScore] = useState(0); 
    const navigate = useNavigate(); // Hook para la redirección
    const [currentTime, setCurrentTime] = useState(new Date().toLocaleString()); // Estado para la hora y fecha actual

    useEffect(() => {
        // Actualiza la hora y fecha cada minuto
        const interval = setInterval(() => {
        setCurrentTime(new Date().toLocaleString());
    }, 60000);
    return () => clearInterval(interval);
    }, []);
        const checkAnswer = () => {
        // Lógica del ejercicio: convierte centímetros a metros
        const centimetersValue = parseFloat(centimeters);
        const correctMeters = centimetersValue / 100;
    
        // Verifica si los campos son correctos
        if (
            centimeters === 'centimeters' &&
            printFunction === 'print' &&
            parseFloat(meters) === correctMeters
        ) {
            setOutput(`¡Correcto! La conversión es: ${correctMeters}`);
            setScore(score + 10); // Incrementa el puntaje si la respuesta es correcta
        } else {
            setOutput('Inténtalo de nuevo.');
        }
        setShowNext(true); // Muestra el botón de siguiente
        };
    
        return (
        <div className="nivel1-container">
            <div className="sidebar">
            <img src="tesis.png" alt="Logo" className="logo" />
            <button className="sidebar-button" onClick={() => navigate('/enunciado14')}>
                <img src="flecha.png" alt="Inicio" className="sidebar-icon" />
                Atrás
            </button>
            <button className="sidebar-button" onClick={() => navigate('/configuracion')}>
                <img src="configuracion.png" alt="Configuración" className="sidebar-icon" />
                CONFIGURACIÓN
            </button>
            <div className="score">
                <img src="puntaje.png" alt="Icono Puntaje" className="score-icon" />
                <p className="score-text">Puntaje: {score}</p>
            </div>
            </div>
            <div className="content">
            <div className="white-background">
                <div className="header">
                <button className="icon-button">
                    <img src="python1.png" alt="Icono Nivel" />
                </button>
                <div className="header-title">
                    <h2>EJERCICIO #15</h2>
                </div>
                <div className="header-status">
                    <span></span>
                    <button className="icon-button">
                    <img src="informacion.png" alt="Icono Moneda" />
                    </button>
                    <button className="icon-button" onClick={() => navigate('/dashboard')}>
                    <img src="ubicacion.png" alt="Icono Pregunta" />
                    </button>
                    <button className="icon-button">
                    <img src="AYUDA.jpeg" alt="Icono Perfil" />
                    </button>
                </div>
                </div>
                <div className="nivel1-card">
                <div className="nivel1-card-header">
                    <span>Ejercicio de Conversión de Unidades</span>
                    <p>Llena los espacios en blanco para completar el código que convierte centímetros a metros.</p>
                </div>
                <div className="nivel1-card-body">
                    <div className="code-box">
                    <div className="code-header">PYTHON</div>
                    <div className="code-content">
                        <pre>
                        <input
                            type="text"
                            value={centimeters}
                            onChange={(e) => setCentimeters(e.target.value)}
                            placeholder="codigo"
                        />
                        = 100<br />
                        meters = <input
                            type="text"
                            value={meters}
                            onChange={(e) => setMeters(e.target.value)}
                            placeholder="codigo"
                        /> / 100<br />
                        <input
                            type="text"
                            value={printFunction}
                            onChange={(e) => setPrintFunction(e.target.value)}
                            placeholder="codigo"
                        />
                        (meters)
                        </pre>
                    </div>
                    </div>
    
                    <button className="nivel1-card-button" onClick={checkAnswer}>
                    Verificar
                    </button>
                    {showNext && (
                    <button
                        className="nivel1-card-button"
                        onClick={() => navigate('/enunciado16')} // Ajusta la ruta según sea necesario
                    >
                        Siguiente
                    </button>
                    )}
    
                    {output && (
                    <div className="code-box">
                        <div className="code-header">SALIDA</div>
                        <pre>{output}</pre>
                    </div>
                    )}
                </div>
                </div>
            </div>
            </div>
        </div>
        );
    };
    
export default Quince;
